import React, { useState } from 'react';
import './SearchProperty.css';

const SearchProperty = ({ properties }) => {
  const [searchCriteria, setSearchCriteria] = useState({
    propertyType: '',
    priceFrom: '',
    priceTo: '',
    city: '',
    realtor: '',
  });
  const [searchResults, setSearchResults] = useState([]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchCriteria({
      ...searchCriteria,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const results = properties.filter(property => {
      // Filter by property type
      if (searchCriteria.propertyType && property.propertyType !== searchCriteria.propertyType) {
        return false;
      }
      // Filter by price range
      if (
        searchCriteria.priceFrom &&
        parseInt(property.price) < parseInt(searchCriteria.priceFrom)
      ) {
        return false;
      }
      if (
        searchCriteria.priceTo &&
        parseInt(property.price) > parseInt(searchCriteria.priceTo)
      ) {
        return false;
      }
      // Filter by city
      if (searchCriteria.city && property.city !== searchCriteria.city) {
        return false;
      }
      // Filter by realtor
      if (searchCriteria.realtor && property.realtor !== searchCriteria.realtor) {
        return false;
      }
      return true;
    });
    setSearchResults(results);
  };

  return (
    <div className="search-property">
      <h2>Поиск недвижимости</h2>
      <form onSubmit={handleSubmit}>
        {/* Form fields */}
        <button type="submit">Искать</button>
      </form>
      {/* Display search results */}
      {searchResults.length > 0 && (
        <div className="search-results">
          <h3>Результаты поиска</h3>
          {searchResults.map(property => (
            <div key={property.id} className="property-item">
              {/* Display property details */}
              <p>{property.title}</p>
              {/* Add more details as needed */}
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default SearchProperty;
